    //          name={name}
    //          role={role}
    //      />
    //     )
    // })

    return (
        <main className={styles.pageContainer}>
            <header className={styles.header}><h1 className={styles.title}>Список сотрудников</h1></header>
            <main className={styles.body}>
                <UsersTable users={users}/>
            </main>
        </main>
    );
};

export default UsersListPage;
